webpackJsonp([21],{142:function(n,e,t){"use strict";Object.defineProperty(e,"__esModule",{value:!0});var r=t(65),i=t.n(r),s=t(66),d=t.n(s),l=t(67),a=t.n(l),u=t(68),o=t.n(u),p=t(69),c=t.n(p),h=t(265),v=(t(289),function(n){function e(){return d()(this,e),o()(this,(e.__proto__||i()(e)).apply(this,arguments))}return c()(e,n),a()(e,[{key:"document",value:function(){return t(445)}}]),e}(h.a));e.default=v},289:function(n,e,t){"use strict";var r=t(290);t.n(r)},290:function(n,e){},445:function(n,e){n.exports='## Input 输入框\n\n最基础的表单输入组件。\n\n### 基础用法\n\n基本用法。\n\n:::demo 通过`type`属性输入类型。\n```js\n  render() {\n    return (\n      <div>\n        <Input type="text" placeholder="请输入" />\n      </div>\n    )\n  }\n```\n:::\n\n### textarea\n\n通过type设置。\n\n:::demo 将`type`属性设置为`textarea`，同时可设置`rows`，`cols`属性。\n```js\n  render() {\n    return (\n      <div>\n        <Input type="textarea" placeholder="请输入" rows={10} />\n      </div>\n    )\n  }\n```\n:::\n\n### 不同尺寸\n\n通过size设置。\n\n:::demo 除了默认大小外，可以设置`xl`,`lg`,`sm`,`xs`四种不同尺寸。\n```js\n  render() {\n    return (\n      <div>\n        <Input style={{width: 150, marginRight: 8}} size="xl" placeholder="请输入" />\n        <Input style={{width: 150, marginRight: 8}} size="lg" placeholder="请输入" />\n        <Input style={{width: 150, marginRight: 8}} size="sm" placeholder="请输入" />\n        <Input style={{width: 150, marginRight: 8}} size="xs" placeholder="请输入" />\n      </div>\n    )\n  }\n```\n:::\n\n### 圆角输入框\n\n通过radius设置。\n\n:::demo 通过`radius`属性设置输入框是否圆角。\n```js\n  render() {\n    return (\n      <div>\n        <Input radius type="text" placeholder="请输入" />\n      </div>\n    )\n  }\n```\n:::\n\n### 禁用状态\n\n通过disabled设置。\n\n:::demo 通过`disabled`属性设置输入框是否禁用。\n```js\n  render() {\n    return (\n      <div>\n        <Input disabled type="text" value="禁用" />\n      </div>\n    )\n  }\n```\n:::\n\n### 监听事件\n\n支持onChange,onFocus,onBlur等标准事件\n\n:::demo 设置`onBlur`事件回调，在失去焦点时触发。\n```js\n  handleBlur(e) {\n    alert(\'输入框的值是：\' + e.target.value);\n  }\n\n  render() {\n    return (\n      <div>\n        <Input type="text" placeholder="请输入" onBlur={(e) => { this.handleBlur(e); }} />\n      </div>\n    )\n  }\n```\n:::\n\n### Attributes\n| 参数      | 说明    | 类型      | 可选值       | 默认值   |\n|---------- |-------- |---------- |-------------  |-------- |\n| type     | 类型   | string  |   text, textarea, number...           |    text     |\n| size     | 尺寸   | string  |   xl, lg, sm, xs        |    -     |\n| radius     | 是否圆角   | boolean  |   -     |    false   |\n| value     | 值   | string  |   -        |    -     |\n| defautValue     | 默认值  | string  |   -     |    -     |\n| className     | 类名   | string  |   -   |    -     |\n| placeholder     | 占位符   | string  |   -      |    -     |\n| disabled     | 是否禁用  | boolean  |   -      |    false    |\n\n\n### Events\n\n和React支持的事件一致。'}});